import React, {useEffect, useState} from 'react';


function App() {

  const [str,setstr] = useState('');

  function buildStr(e){
    let newStr = str + e;
    setstr(newStr);
  }
  return (
    <div className="App">
      <div className="Buttons">
        <div className="row">
          <div className="button" onclick={buildStr(A)}>A</div>
          <div className="button" onclick={buildStr(B)}>B</div>
          <div className="button" onclick={buildStr(C)}>C</div>
          <div className="button" onclick={buildStr(D)}>D</div>
          <div className="button" onclick={buildStr(E)}>E</div>
          <div className="button" onclick={buildStr(F)}>F</div>
          <div className="button" onclick={buildStr(G)}>G</div>
        </div>

      </div>
      <footer>Made by Cristian Reyes</footer>
    </div>
  );
}

export default App;
